import React from 'react';
import styled from 'styled-components';
import Background from './background.png';

const Container = styled.div`
  width: 100%;
  height: 100%;
  background-image: url(${Background});
`;

export default function Index() {
  return (
    <Container>
      <p>Hello</p>
    </Container>
  );
}
